import React from "react";
import { Box, Flex, Image, Button } from "rebass";
// import logo from "../static/ftwllogo.png";
import "./Navbar.css";

function Navbar() {
  return (
    <Box p={5} fontSize={4} width={[1, 1, 1]} color="black" bg="blue">
      <Flex>
        <Box
          p={5}
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="gray"
        >
          {/* <Image
            src={logo}
            sx={{
              width: ["100%", "50%"],
              borderRadius: 8
            }}
          /> */}
        </Box>
        <Box
          p={5}
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="white"
        >
          About Us
        </Box>
        <Box
          p={5}
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="yellow"
        >
          Ways to Give
        </Box>
        <Box
          p={5}
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="orange"
        >
          Found an Animal?
        </Box>
        <Box
          p={5}
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="red"
        >
          News & Events
        </Box>
        <Box
          p={5}
          fontSize={2}
          width={[3 / 8, 3 / 8, 3 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="green"
        >
          Everything
          <Button variant="primary" mr={2}>
            Primary
          </Button>
          <Button variant="secondary" mr={2}>
            Secondary
          </Button>
        </Box>
      </Flex>
    </Box>
  );
}

export default Navbar;
